        private static async Task GuardarSucursalesEnBaseDeDatos(List<Sucursal> sucursales)
        {
            string connectionString = ConfigurationManager.ConnectionStrings["cadena_conexion"].ConnectionString;

            using (SqlConnection connection = new SqlConnection(connectionString))
            {
                await connection.OpenAsync();

                // Obtener todas las sucursales existentes
                var existingSucursales = new Dictionary<string, int>();
                string selectQuery = "SELECT IdSucursal, Nombre FROM SUCURSAL";
                using (SqlCommand selectCommand = new SqlCommand(selectQuery, connection))
                {
                    using (SqlDataReader reader = await selectCommand.ExecuteReaderAsync())
                    {
                        while (await reader.ReadAsync())
                        {
                            existingSucursales[reader["Nombre"].ToString()] = (int)reader["IdSucursal"];
                        }
                    }
                }

                foreach (var sucursal in sucursales)
                {
                    // Intentamos obtener el IdSucursal basado en el nombre de la sucursal
                    if (existingSucursales.TryGetValue(sucursal.NombreSucursal, out int idSucursal)) // Verificar si existe
                    {
                        // Actualizamos la sucursal existente
                        string updateQuery = "UPDATE SUCURSAL SET Direccion = @Direccion, Telefono = @Telefono WHERE IdSucursal = @IdSucursal";
                        using (SqlCommand updateCommand = new SqlCommand(updateQuery, connection))
                        {
                            updateCommand.Parameters.AddWithValue("@Direccion", sucursal.Direccion);
                            updateCommand.Parameters.AddWithValue("@Telefono", sucursal.Telefono);
                            updateCommand.Parameters.AddWithValue("@IdSucursal", idSucursal);
                            await updateCommand.ExecuteNonQueryAsync();
                        }
                    }
                    else // Si no existe, insertamos una nueva sucursal
                    {
                        string insertQuery = "INSERT INTO SUCURSAL (Nombre, Direccion, Telefono) VALUES (@Nombre, @Direccion, @Telefono)";
                        using (SqlCommand insertCommand = new SqlCommand(insertQuery, connection))
                        {
                            insertCommand.Parameters.AddWithValue("@Nombre", sucursal.NombreSucursal);
                            insertCommand.Parameters.AddWithValue("@Direccion", sucursal.Direccion);
                            insertCommand.Parameters.AddWithValue("@Telefono", sucursal.Telefono);
                            await insertCommand.ExecuteNonQueryAsync();
                        }
                    }
                }
            }
        }


