        private void BuscarProductos()
        {
            string searchText = txtProducto.Text.Trim();

            if (string.IsNullOrEmpty(searchText))
            {
                MessageBox.Show("Por favor, ingresa un nombre de producto para buscar.");
                return;
            }

            try
            {
                using (SqlConnection conn = new SqlConnection(ConfigurationManager.ConnectionStrings["cadena_conexion"].ConnectionString))
                {
                    conn.Open();
                    string query = "SELECT IdProducto, Codigo, Nombre, Descripcion, IdCategoria, Stock, PrecioCompra, PrecioVenta, Estado, FechaRegistro FROM PRODUCTO WHERE Nombre LIKE @nombre";
                    using (SqlCommand cmd = new SqlCommand(query, conn))
                    {
                        cmd.Parameters.AddWithValue("@nombre", "%" + searchText + "%");

                        using (SqlDataAdapter adapter = new SqlDataAdapter(cmd))
                        {
                            DataTable dt = new DataTable();
                            adapter.Fill(dt);

                            dgProducto.Rows.Clear();
                            dgProducto.Columns.Clear();

                            dgProducto.Columns.Add("IdProducto", "Id Producto");
                            dgProducto.Columns.Add("Codigo", "Código");
                            dgProducto.Columns.Add("Nombre", "Nombre");
                            dgProducto.Columns.Add("Descripcion", "Descripción");
                            dgProducto.Columns.Add("IdCategoria", "Id Categoría");
                            dgProducto.Columns.Add("Stock", "Stock");
                            dgProducto.Columns.Add("PrecioCompra", "Precio Compra");
                            dgProducto.Columns.Add("PrecioVenta", "Precio Venta");
                            dgProducto.Columns.Add("Estado", "Estado");
                            dgProducto.Columns.Add("FechaRegistro", "Fecha Registro");

                            if (dt.Rows.Count > 0)
                            {
                                foreach (DataRow row in dt.Rows)
                                {
                                    dgProducto.Rows.Add(
                                        row["IdProducto"].ToString(),
                                        row["Codigo"].ToString(),
                                        row["Nombre"].ToString(),
                                        row["Descripcion"].ToString(),
                                        row["IdCategoria"].ToString(),
                                        row["Stock"].ToString(),
                                        row["PrecioCompra"].ToString(),
                                        row["PrecioVenta"].ToString(),
                                        row["Estado"].ToString(),
                                        Convert.ToDateTime(row["FechaRegistro"]).ToString("yyyy-MM-dd HH:mm:ss")
                                    );
                                }
                            }
                            else
                            {
                                MessageBox.Show("No se encontraron productos.");
                            }
                        }
                    }
                }
            }
            catch (SqlException sqlEx)
            {
                MessageBox.Show("Error en la consulta: " + sqlEx.Message);
            }
            catch (Exception ex)
            {
                MessageBox.Show("Error inesperado: " + ex.Message);
