        private async void btnEnviar_Click(object sender, EventArgs e)
        {
            try
            {
                long folioNumerico = long.Parse(DateTime.Now.ToString("yyyyMMddHHmmss"));

                if (!await IsInternetAvailable())
                {
                    MessageBox.Show("Se requiere conexión a Internet para continuar.", "Error de Conexión", MessageBoxButtons.OK, MessageBoxIcon.Error);
                    return;
                }

                if (dgFactura.Rows.Count == 0)
                {
                    MessageBox.Show("No hay productos para enviar.", "Error", MessageBoxButtons.OK, MessageBoxIcon.Warning);
                    return;
                }

                Negocio datos = new CN_Negocio().ObtenerDatos();
                if (datos == null)
                {
                    MessageBox.Show("No se pudo obtener los datos de la sucursal.", "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
                    return;
                }

                string nombreSucursal = datos.Nombre;
                int idSucursalEnvio = 4; // Reemplaza con el ID correcto
                string nombreEmpleado = _Usuario.NombreCompleto;

                // Pasa el valor 'folioNumerico' al método
                var detalles = await ObtenerDetallesDesdeDataGridView(folioNumerico);

                if (detalles == null) return; // Si hubo un error en la obtención de detalles

                int idTranspasoGenerado = RegistrarTraspaso(idSucursalEnvio, folioNumerico, nombreEmpleado, detalles);

                if (idTranspasoGenerado == 0) return; // Si el registro falló

                byte[] imageBytes = null; // Cargar bytes de imagen si es necesario
                GenerarPDF(nombreSucursal, detalles, imageBytes, folioNumerico);

                string json = JsonConvert.SerializeObject(detalles);
                bool envioExitoso = await EnviarDatosAApi(json);

                MessageBox.Show(envioExitoso ? "Todos los productos han sido enviados exitosamente." : "Error al enviar los productos.", "Resultado", MessageBoxButtons.OK, envioExitoso ? MessageBoxIcon.Information : MessageBoxIcon.Error);
            }
            catch (Exception ex)
            {
                MessageBox.Show($"Ocurrió un error inesperado: {ex.Message}", "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
            }
        }

        private int RegistrarTraspaso(int idSucursalEnvio, long folioNumerico, string nombreEmpleado, List<DetallesTranspaso> detalles)
        {
            CN_traspasos traspasos = new CN_traspasos();
            string mensaje;
            int idTranspasoGenerado = traspasos.RegistrarTranspaso(idSucursalEnvio, folioNumerico, nombreEmpleado, detalles, out mensaje);

            if (idTranspasoGenerado == 0)
            {
                MessageBox.Show("Error al registrar el traspaso: " + mensaje, "Error", MessageBoxButtons.OK, MessageBoxIcon.Error);
            }

            return idTranspasoGenerado;
        }
        private async Task<List<DetallesTranspaso>> ObtenerDetallesDesdeDataGridView(long folioNumerico)
        {
            var detalles = new List<DetallesTranspaso>();

            foreach (DataGridViewRow row in dgFactura.Rows)
            {
                if (row.IsNewRow) continue;

                if (row.Cells["Producto"].Value != null && row.Cells["Cantidad"].Value != null)
                {
                    string nombreProducto = row.Cells["Producto"].Value.ToString();
                    if (int.TryParse(row.Cells["Cantidad"].Value.ToString(), out int stock))
                    {
                        detalles.Add(new DetallesTranspaso { FOLIO = (int)folioNumerico, NombreProducto = nombreProducto, stok = stock });
                    }
                    else
                    {
                        MessageBox.Show($"La cantidad '{row.Cells["Cantidad"].Value}' no es un número válido.", "Error de Cantidad", MessageBoxButtons.OK, MessageBoxIcon.Warning);
                        return null; // Indica que hubo un error
                    }
                }
                else
                {
                    MessageBox.Show("Alguna de las celdas de producto o cantidad está vacía.", "Error", MessageBoxButtons.OK, MessageBoxIcon.Warning);
                    return null; // Indica que hubo un error
                }
            }

            return detalles;
        }




        private async Task<bool> EnviarDatosAApi(string jsonData)
        {
            // Mostrar el JSON en un MessageBox antes de enviarlo
            MessageBox.Show(jsonData, "JSON a enviar", MessageBoxButtons.OK, MessageBoxIcon.Information);

            using (HttpClient client = new HttpClient())
            {
                string apiUrl = "https://software.bigcluboutlet.com/venta/api/transpasos.php"; // Cambia esto a tu URL de API

                var content = new StringContent(jsonData, Encoding.UTF8, "application/json");

                HttpResponseMessage response = await client.PostAsync(apiUrl, content);

                return response.IsSuccessStatusCode; // Devuelve verdadero si la respuesta es exitosa
            }
        }



        
