        private void GenerarPDF(string sucursal, List<CapaEntidad.DetallesTranspaso> productos, byte[] imageBytes, long folioNumerico)
        {
            // Obtener la fecha actual y formatearla
            string fechaActual = DateTime.Now.ToString("yyyyMMddHHmmss");
            string fechaTexto = DateTime.Now.ToString("yyyy-MM-dd HH:mm:ss").Replace("-", " ").Replace(":", " ");

            // Crear el documento PDF
            Document doc = new Document(PageSize.A4, 50, 50, 25, 25); // Márgenes ajustados
            string ruta = Path.Combine(Environment.GetFolderPath(Environment.SpecialFolder.MyDocuments), $"Documento_{fechaActual}.pdf");

            try
            {
                PdfWriter.GetInstance(doc, new FileStream(ruta, FileMode.Create));
                doc.Open();

                // Agregar un espacio inicial
                doc.Add(new Paragraph("\n"));

                // Agregar una tabla para el encabezado
                PdfPTable headerTable = new PdfPTable(1);
                headerTable.DefaultCell.Border = iTextSharp.text.Rectangle.NO_BORDER; // Sin borde
                headerTable.HorizontalAlignment = Element.ALIGN_CENTER;

                // Título del documento
                var titleFont = FontFactory.GetFont("Arial", 28, BaseColor.BLUE);
                PdfPCell titleCell = new PdfPCell(new Phrase("Reporte de Productos", titleFont))
                {
                    BackgroundColor = new BaseColor(230, 230, 250), // Color de fondo
                    Border = iTextSharp.text.Rectangle.BOTTOM_BORDER,
                    BorderColor = BaseColor.BLUE,
                    Padding = 10
                };
                titleCell.HorizontalAlignment = Element.ALIGN_CENTER;
                headerTable.AddCell(titleCell);

                doc.Add(headerTable);
                doc.Add(new Chunk("\n")); // Espacio en blanco

                // Agregar la imagen en binario
                if (imageBytes != null && imageBytes.Length > 0)
                {
                    iTextSharp.text.Image logo = iTextSharp.text.Image.GetInstance(imageBytes);
                    logo.ScaleToFit(200f, 100f); // Ajusta el tamaño de la imagen según sea necesario
                    logo.Alignment = Element.ALIGN_CENTER;
                    doc.Add(logo);
                    doc.Add(new Chunk("\n")); // Espacio en blanco
                }

                // Agregar el folio (fecha)
                var folioFont = FontFactory.GetFont("Arial", 14, BaseColor.BLACK);
                doc.Add(new Paragraph($"Folio: {folioNumerico}", folioFont) { Alignment = Element.ALIGN_CENTER });
                doc.Add(new Chunk("\n")); // Espacio en blanco

                // Obtener datos de la sucursal actual
                Negocio datos = new CN_Negocio().ObtenerDatos();
                // Agregar información de la sucursal y el empleado
                doc.Add(new Paragraph($"Sucursal: {datos.Nombre}", FontFactory.GetFont("Arial", 12, BaseColor.BLACK)));
                doc.Add(new Paragraph($"Nombre de Empleado: {_Usuario.NombreCompleto}", FontFactory.GetFont("Arial", 12, BaseColor.BLACK)));
                doc.Add(new Chunk("\n")); // Espacio en blanco

                // Crear una tabla para el contenido
                PdfPTable contentTable = new PdfPTable(2); // Dos columnas: Producto y Stock
                contentTable.WidthPercentage = 100; // Ancho total de la tabla
                contentTable.DefaultCell.Border = iTextSharp.text.Rectangle.BOX; // Borde para la tabla
                contentTable.DefaultCell.BorderColor = BaseColor.GRAY;
                contentTable.DefaultCell.Padding = 10;

                // Encabezados de los productos
                contentTable.AddCell(new Phrase("Producto", FontFactory.GetFont("Arial", 12, BaseColor.BLACK)));
                contentTable.AddCell(new Phrase("Stock", FontFactory.GetFont("Arial", 12, BaseColor.BLACK)));

                // Agregar los productos a la tabla
                foreach (var producto in productos)
                {
                    string nombreProducto = producto.GetType().GetProperty("Producto")?.GetValue(producto, null)?.ToString() ?? "No disponible";
                    int stock = Convert.ToInt32(producto.GetType().GetProperty("Stock")?.GetValue(producto, null) ?? 0);

                    contentTable.AddCell(new Phrase(nombreProducto, FontFactory.GetFont("Arial", 12, BaseColor.BLACK)));
                    contentTable.AddCell(new Phrase(stock.ToString(), FontFactory.GetFont("Arial", 12, BaseColor.BLACK)));
                }

                // Agregar la tabla de contenido al documento
                doc.Add(contentTable);
            }
            catch (Exception ex)
            {
                MessageBox.Show($"Error al generar el PDF: {ex.Message}");
            }
            finally
            {
                // Cerrar el documento
                if (doc.IsOpen())
                {
                    doc.Close();
                }

                MessageBox.Show($"Documento PDF generado con éxito: {ruta}");
            }
        }









